import React from 'react';
import ContentSection from '../../ContentSection/ContentSection';
import './UsefulLinks.scss';

const UsefulLinks : React.FC = props => {
    return (
        <ContentSection className={`useful-links`}>
            <h2>Useful links</h2>
            <a href='https://www.diplomatie.gouv.fr/fr/conseils-aux-voyageurs/conseils-par-pays-destination/grece/' target='_blank'>France Diplomatie</a><br></br>
            <a href='https://travel.gov.gr/#/' target='_blank'>Protocol for arrivals in Greece</a><br></br>
            <a href='https://www.athenstransport.com/english/tickets/' target='_blank'>Transport</a><br></br>
        </ContentSection>
    );
}

export default UsefulLinks;
